// SectionSeparator.js
import React from 'react';

const SectionSeparator = ({ top }) => {
    const separatorStyle = {
        position: 'fixed',
        top: top,
        left: 0,
        width: '100%',
        height: '100vh',
        zIndex: -1,
        // Autres styles selon vos besoins
    };

    return <div className="section-separator" style={separatorStyle}></div>;
};

export default SectionSeparator;
